import React from 'react'
import { Link } from 'react-router-dom'



export default function NoteCard({ title, _id, tag, createdAt }) {
	return (
		<div>
			<Link to={`/notes/${_id}`}>
				<h3>{title}</h3>
			</Link>
            <p>{tag}</p>
			<p>Created: {createdAt.slice(0, 10)} </p>

		</div>
	)
}
